var expect=require("expect.js"),cheerio=require(".."),food=require("./fixtures").food;describe("utility methods",function(){describe(".contains",function(){var n;beforeEach(function(){n=cheerio.load(food)}),it("(container, contained) : should correctly detect the provided element",function(){var e=n("#food"),t=n("#fruits"),o=n(".apple");expect(n.contains(e[0],t[0])).to.equal(!0),expect(n.contains(e[0],o[0])).to.equal(!0)}),it("(container, other) : should not detect elements that are not contained",function(){var e=n("#fruits"),t=n("#vegetables"),o=n(".apple");expect(n.contains(t[0],o[0])).to.equal(!1),expect(n.contains(e[0],t[0])).to.equal(!1),expect(n.contains(t[0],e[0])).to.equal(!1),expect(n.contains(e[0],e[0])).to.equal(!1),expect(n.contains(t[0],t[0])).to.equal(!1)})})});